import logo from './logo.svg';
import './App.css';
import NavBar from './components/NavBar';
import AboutUs from './components/AboutUs'
import ContactUs from './components/ContactUs';

function App() {
  return (
    <div className="App">
    <NavBar></NavBar>
    <AboutUs></AboutUs>
    <ContactUs></ContactUs>
    </div>
  );
}

export default App;
